Ο Συνταγματάρχης το δέχτηκε και αργότερα υποκλίθηκε, βγάζοντας το φαρδύ καπέλο του. Δικαιούμαστε να πούμε ότι "Ο συνταγματάρχης παρέλαβε ένα μετάλλιο από τον δήμαρχο της Νέας Υόρκης."; Ναι, όχι, ή ίσως;
Μπορεί

έχεις διαβάσει Τη Φίρμα Δικαιούμαστε να πούμε ότι "Έχεις διαβάσει το The Soft;"; Ναι, όχι, ή ίσως;
Οχι

ουάου ίσως πρέπει να πάω να το δω σε ένα θέατρο και να σχεδιάσω να βγούμε για δείπνο μετά για να μπορέσουμε να καθίσουμε και να μιλήσουμε γι 'αυτό Δικαιούμαστε να πούμε ότι "Μπορούμε να πάμε στο δείπνο μετά το σόου."; Ναι, όχι, ή ίσως;
Ναί

και εσωτερικός έλεγχος σε κάποιο από τα δυο 6 Δικαιούμαστε να πούμε ότι "Κάποια έχουν εσωτερικές ρυθμίσεις."; Ναι, όχι, ή ίσως;
Ναί

Όταν η επίθεση ήταν αποφασισμένο να συσχετιστεί με την Αλ Κάιντα, η ευθύνη μεταφέρθηκε στο New York Field Office. Δικαιούμαστε να πούμε ότι "Το Field Office της Νέας Υόρκης το χειρίστηκε όταν αποφάσισαν ότι η Αλ Κάιντα ήταν αναμεμειγμένη."; Ναι, όχι, ή ίσως;
Ναί

702 / 369-1540) το παλαιότερο καφενείο στο Λας Βέγκας και, σύμφωνα με μερικούς, εξακολουθεί να είναι το καλύτερο με όλη τη μποέμικη δόξα του. Δικαιούμαστε να πούμε ότι "Το Vegas δεν έχει καφετέριες."; Ναι, όχι, ή ίσως;
Οχι

Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Δικαιούμαστε να πούμε ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
